INSERT INTO especialidad (id, version, nombre, descripcion) VALUES
( 1, 0, 'ALERGIA E INMUNOLOGÍA', 'Es la especialidad médica que comprende el conocimiento, diagnóstico y tratamiento de la patología producida por mecanismos inmunológicos.'),
( 2, 0, 'ANATOMÍA PATOLÓGICA', ' es la especialidad que se ocupa del estudio, por medio de técnicas morfológicas, de las causas, el desarrollo y las consecuencias de las enfermedades. El fin último de esta especialidad es el diagnóstico correcto de biopsias, piezas quirúrgicas, citologías y autopsias.'),
( 3, 0, 'ANESTESIOLOGÍA', ' La anestesiología es la especialidad médica dedicada a la atención y cuidados especiales de los pacientes durante las intervenciones quirúrgicas u otros procesos que puedan resultar molestos o dolorosos endoscopia, radiología intervencionista, etc.). Así mismo, tiene a su cargo el tratamiento del dolor agudo o crónico de causa extraquirúrgica. Ejemplos de estos últimos son la analgesia durante el trabajo de parto y el alivio del dolor en pacientes con cáncer.'),
( 4, 0, 'ANGIOLOGÍA GENERAL y HEMODINAMIA', ' Es la especialidad médica que se encarga del estudio de los vasos del sistema circulatorio (venas y arterias) y del sistema linfático; incluyendo la anatomía de los vasos sanguíneos (como arterias, venas, capilares) y la de los linfáticos, además de sus enfermedades La hemodinámica es la que se encarga del estudio de la dinámica de la sangre en el interior de las estructuras sanguíneas como arterias, venas, vénulas, arteriolas y capilares así como también la mecánica del corazón'),
( 5, 0, 'CARDIOLOGÍA', ' Es la especialidad médica, encargada del estudio, diagnóstico y tratamiento de las enfermedades del corazón y del aparato circulatorio.'),
( 6, 0, 'CARDIÓLOGO INFANTIL', ' es la especialidad que tiene como fundamento la aplicación del saber y quehacer médico-quirúrgico cardiológico en el periodo de la vida humana que se extiende desde la concepción hasta la adolescencia.'),
( 7, 0, 'CIRUGÍA GENERAL', ' Es la especialidad médica que abarca las operaciones del aparato digestivo; incluyendo el tracto gastrointestinal y el sistema hepato-biliopancreático, el sistema endocrino; incluyendo las glándulas suprarrenales, tiroides, paratiroides, mama y otras glándulas incluidas en el aparato digestivo. Asimismo incluye la reparación de hernias y eventraciones de la pared abdominal.'),
( 8, 0, 'CIRUGÍA CARDIOVASCULAR', ' Es la especialidad quirúrgica que se ocupa del corazón o grandes vasos se utiliza para tratar complicaciones de la cardiopatía isquémica corregir malformaciones cardíacas congénitas, o tratar enfermedades valvulares del corazón debidas a causas diversas, como la endocarditis. También incluye el trasplante cardíaco.'),
( 9, 0, 'CIRUGÍA DE CABEZA Y CUELLO', ' Es la especialidad médica que se dedica al estudio, prevención, diagnóstico, tratamiento y rehabilitación de las enfermedades congénitas y adquiridas del cráneo, cara, cabeza y cuello, cavidad oral y maxilares (incluyendo la dentición). La patología adquirida puede ser de origen tumoral, traumático, por degeneración o envejecimiento.'),
(10, 0, 'CIRUGÍA DE TÓRAX (CIRUGÍA TORÁCICA)', ' La cirugía torácica es una especialidad médica dedicada al estudio y tratamiento quirúrgico de las enfermedades que afectan al tórax.'),
(11, 0, 'CIRUGÍA INFANTIL (CIRUGÍA PEDIÁTRICA)', ' La cirugía es la especialidad dedicada al diagnóstico, cuidado preoperatorio, operación y manejo postoperatorio de los problemas que presentan el feto, lactante, escolar, adolescente y joven adulto.'),
(12, 0, 'CIRUGÍA PLÁSTICA Y REPARADORA', ' Es la especialidad que tiene por objeto la corrección y/o mejoramiento de anormalidades de origen congénito, adquirido, tumoral o involutiva que requieran reparación o reposición de la forma corporal y su función.'),
(13, 0, 'CIRUGÍA VASCULAR PERIFÉRICA', ' La Angiología y Cirugía vascular es una especialidad médico-quirúrgica dedicada al estudio, prevención, diagnóstico clínico e instrumental y tratamiento de la patología vascular'),
(14, 0, 'CLÍNICA MÉDICA', ' Es una especialidad médica que atiende integralmente los problemas de salud en pacientes adultos, ingresados en un centro hospitalario o en consultas ambulatorias.'),
(15, 0, 'COLOPROCTOLOGÍA', ' Es la especialidad de la medicina derivada de la cirugía general que brinda diagnóstico y tratamiento quirúrgico y no quirúrgico de las enfermedades del cólon, recto y ano'),
(16, 0, 'DERMATOLOGÍA', ' Es la especialidad médica encargada del estudio de la estructura y función de la piel, así como de las enfermedades que la afectan, su diagnóstico, prevención y tratamiento.'),
(17, 0, 'DIAGNOSTICO POR IMÁGENES', ' Es la especialidad médica, que se ocupa de generar imágenes del interior del cuerpo mediante diferentes agentes físicos (rayos X, ultrasonidos, campos magnéticos, entre otros) y de utilizar estas imágenes para el diagnóstico de las enfermedades.'),
(18, 0, 'ENDOCRINOLOGÍA', ' es la especialidad médica que estudia el sistema endocrino y las enfermedades provocadas por un funcionamiento inadecuado del mismo.'),
(19, 0, 'ENDOCRINÓLOGO INFANTIL', ' Especialidad de la medicina que estudia la anatomía, funcionamiento y enfermedades del sistema endocrino y sus glándulas endocrinas, páncreas, tiroides, suprarrenales, hipófisis, gónadas del paciente pediátrico'),
(20, 0, 'FARMACOLOGÍA CLÍNICA', ' Es la especialidad que estudia la historia, el origen, las propiedades físicas y químicas, la presentación, los efectos bioquímicos y fisiológicos, los mecanismos de acción, la absorción, la distribución, la biotransformación y la excreción así como el uso terapéutico de los fármacos que interactúan con los organismos vivos.'),
(21, 0, 'FISIATRÍA (MEDICINA FÍSICA Y REHABILITACIÓN)', ' Es una especialidad de la medicina que promociona la salud y previene, diagnostica, evalúa, prescribe y trata el estado de enfermedad. Establece una prioridad en el logro de objetivos de funcionalidad ergonómicos, ocupacionales y de reintegración social.'),
(22, 0, 'GASTROENTEROLOGÍA', ' Es la especialidad médica que se ocupa de la atención, diagnóstico y tratamiento de las enfermedades del aparato digestivo y órganos asociados, conformado Por esófago, estómago, hígado y vías biliares, páncreas, intestino delgado (duodeno, yeyuno, íleon), colon y recto.'),
(23, 0, 'GASTROENTERÓLOGO INFANTIL', ' Es la Especialidad que atiende niños y adolescentes con enfermedades digestivas (esófago, estómago e intestino) y enfermedades hepáticas.'),
(24, 0, 'GENÉTICA MEDICA', ' Es la aplicación de la genética en el contexto de la medicina. El campo de aplicación de la genética médica es amplio y variado. Incluye diferentes áreas individuales tales como la genética clínica, la genética bioquímica, la genética molecular, la citogenética, la genética de enfermedades comunes y el consejo o asesoramiento genético.'),
(25, 0, 'GERIATRÍA', ' Es una especialidad médica dedicada al estudio de la prevención, el diagnóstico, el tratamiento y la rehabilitación de las enfermedades en las personas de la tercera edad.'),
(26, 0, 'GINECOLOGÍA', ' La ginecología es una especialidad médica, pero también tiene algunas vertientes quirúrgicas. se dedica al estudio y tratamiento de diversos problemas y enfermedades del aparato genital femenino.'),
(27, 0, 'HEMATOLOGÍA', ' Es la especialidad médica que se dedica al tratamiento de los pacientes con enfermedades de la sangre o hematológicas.'),
(28, 0, 'HEMATÓLOGO INFANTIL', ' La hematología estudia y trata las enfermedades de la sangre relacionadas con alteraciones de los glóbulos rojos (como los distintos tipos de anemias), glóbulos blancos (neutropenias congénitas, adquiridas o malignas), y plaquetas (como las púrpuras). También las enfermedades hemorrágicas, principalmente hemofilias'),
(29, 0, 'HEMOTERAPIA E INMUNOHEMATOLOGÍA', 'Ley de sangre 22.990/83 por decreto 1338/04 en su Art 5. Se entiende por Hemoterapia la especialidad médica que comprende la dirección, implementación y evaluación de los procesos antes citados, los que se deberán realizar en estrecha vinculación interdisciplinaria con las demás profesiones (en especial en lo referente a la producción de hemoderivados y la detección y control de infecciones transmisibles por transfusión) y con las especialidades médicas que intervienen en la atención de los pacientes, en particular en cuanto al diagnóstico, tratamiento y prevención de las enfermedades citopénicas perinatales, en las enfermedades inmunohematológicas, en los procedimientos de aféresis terapéutica y de autotransfusión en todas sus modalidades".'),
(30, 0, 'INFECTOLOGÍA', ' La infectología es especialidad de la medicina interna y de la pediatría que se encarga del estudio, la prevención, el diagnóstico, tratamiento y pronóstico de las enfermedades producidas por agentes infecciosos (bacterias, virus, hongos y parásitos).'),
(31, 0, 'INFECTÓLOGO INFANTIL', ' Es la especialidad médica en el área de la pediatría que se encarga de la prevención, diagnóstico y tratamiento de Enfermedades Infecciosas, enfermedades causadas por virus, bacterias, hongos y parásitos.'),
(32, 0, 'MEDICINA DEL DEPORTE', ' Es la especialidad médica que estudia los efectos del ejercicio del deporte y, en general, de la actividad física, en el organismo humano, desde el punto de vista de la prevención y tratamiento de las enfermedades y lesiones.'),
(33, 0, 'MEDICINA GENERAL y/o MEDICINA DE FAMILIA', ' Es especialidad médica que proporciona atención sanitaria continua e integral al individuo y a la familia. Es la especialidad que integra las ciencias biológicas, clínicas, sociales y del comportamiento. El ámbito de la medicina familiar abarca todas las edades, ambos sexos, cada uno de los sistemas orgánicos y todas las enfermedades. Orientada a la Atención Primaria.'),
(34, 0, 'MEDICINA LEGAL', ' Es la especialidad que permite al profesional médico especializado, realizar informes técnicos y pericias relacionadas a sus especialidades asistenciales, asistir a Magistrados cuando éste lo requiera, pudiendo establecer, causalidades sobre los daños físicos reclamados y fijar eventuales incapacidades físicas conforme a derecho.'),
(35, 0, 'MEDICINA NUCLEAR', ' Es una especialidad que diagnostica y determina la gravedad y tratamiento de una o varias enfermedades, incluyendo cáncer en diversos tipos, enfermedades cardíacas, gastrointestinales, endocrinas, desórdenes neurológicos, y otras anomalías dentro del cuerpo donde se utilizan radiotrazadores o radiofármacos, que están formados por un fármaco transportador y un isótopo radiactivo. Estos radiofármacos se aplican dentro del organismo humano por diversas vías (la más utilizada es la vía intravenosa). Una vez que el radiofármaco está dentro del organismo, se distribuye por diversos órganos dependiendo del tipo de radiofármaco empleado. La distribución del radiofármaco es detectado por un aparato detector de radiación llamado gammacámara y almacenado digitalmente. Luego se procesa la información obteniendo imágenes de todo el cuerpo o del órgano en estudio. Estas imágenes, a diferencia de la mayoría de las obtenidas en radiología, son imágenes funcionales y moleculares, es decir, muestran como están funcionando'),
(36, 0, 'MEDICINA DEL TRABAJO', ' Es la especialidad médica que se dedica al estudio de las enfermedades y los accidentes que se producen por causa o consecuencia de la actividad laboral, así como las medidas de prevención que deben ser adoptadas para evitarlas o aminorar sus consecuencias'),
(37, 0, 'NEFROLOGÍA', ' Es la especialidad clínica que se ocupa del estudio de la anatomía, fisiología, patología, promoción de salud, prevención, clínica, terapéutica y rehabilitación de las enfermedades del aparato urinario en su totalidad.'),
(38, 0, 'NEFRÓLOGO INFANTIL', ' La nefrología infantil se dedica a diagnosticar y tratar las enfermedades de todo el tracto urinario en los niños'),
(39, 0, 'NEONATOLOGÍA', ' es una especialidad dedicada a la atención del recién nacido hasta los 28 días, sea éste sano o enfermo, termino, pretermino dividida en recién nacido inmediato hasta 48 horas de vida y mediato hasta 28 días de vida'),
(40, 0, 'NEUMONOLOGÍA', ' Es la especialidad médica encargada del estudio de las enfermedades del aparato respiratorio y centra su campo de actuación en el diagnóstico, tratamiento y prevención de las enfermedades del pulmón la pleura y el mediastino.'),
(41, 0, 'NEUMONÓLOGO INFANTIL', ' Es la especialidad médica encargada del estudio de las enfermedades del aparato respiratorio y centra su campo de actuación en el diagnóstico, tratamiento y prevención de las enfermedades del pulmón la pleura y el mediastino desde el recién nacido al adolescente.'),
(42, 0, 'NEUROCIRUGÍA', ' Es la especialidad médica que se encarga del manejo quirúrgico (incluyendo la educación, prevención, diagnóstico, evaluación, tratamiento, cuidados intensivos, y rehabilitación) de determinadas enfermedades del sistema nervioso central, periférico y vegetativo, incluyendo sus estructuras vasculares'),
(43, 0, 'NEUROLOGÍA', ' Es la especialidad médica que trata los trastornos del sistema nervioso, su prevención, diagnóstico, tratamiento y rehabilitación.'),
(44, 0, 'NEURÓLOGO INFANTIL', ' Es la especialidad médica que trata los trastornos del sistema nervioso en pediatria.'),
(45, 0, 'NUTRICIÓN', ' Es la especialidad médica que estudia la alimentación humana y su relación con los procesos químicos, biológicos y metabólicos, así como su relación con la composición corporal y estado de salud humana. La nutrición comprende el estudio de los alimentos, los nutrientes, su clasificación, digestión así como su asimilación, metabolismo y excreción. Establece la necesidad de los nutrientes y su requerimiento en situaciones especiales, así como su relación con la salud y la enfermedad. Dietas para diabéticos, hipertensos'),
(46, 0, 'OBSTETRICIA', ' La especialidad médica que se ocupa del embarazo, el parto y el puerperio.'),
(47, 0, 'OFTALMOLOGÍA', ' Es la especialidad médica que estudia las enfermedades de ojo y su tratamiento, incluyendo el globo ocular, su musculatura, el sistema lagrimal y los párpados'),
(48, 0, 'ONCOLOGÍA', ' Especialidad médica dedicada al diagnóstico y tratamiento del cáncer.'),
(49, 0, 'ONCÓLOGO INFANTIL', ' Especialidad de la pediatría que se preocupa de diagnóstico, tratamiento y seguimiento del cáncer infantil.'),
(50, 0, 'ORTOPEDIA Y TRAUMATOLOGÍA', ' Es la especialidad médica que se dedica al estudio de las lesiones del aparato locomotor. La especialidad es médico quirúrgica, su ámbito se extiende más allá del campo de las lesiones traumáticas; abarca el estudio de las enfermedades congénitas o adquiridas que afectan al aparato locomotor, especialmente de aquellas que precisan tratamiento con cirugía, prótesis. Algunos de las enfermedades de las que se ocupa la traumatología son las fracturas y luxaciones de los huesos, las lesiones de ligamentos, tendones y músculos, también los tumores óseos y afecciones de la columna vertebral como la hernia discal y la escoliosis.'),
(51, 0, 'OTORRINOLARINGOLOGÍA', ' Es la especialidad médica que se encarga del estudio tanto médico como quirúrgico, de las enfermedades del oído, las vías aéreorespiratorias superiores y parte de las inferiores, incluyendo nariz, senos paranasales, faringe y laringe.'),
(52, 0, 'PEDIATRÍA', ' La pediatría es la especialidad que estudia al niño y sus enfermedades. Pero su contenido es mucho mayor que la curación de las enfermedades de los niños, ya que la pediatría estudia tanto al niño sano como al enfermo. Cronológicamente, la pediatría abarca desde el nacimiento hasta la adolescencia. Dentro de ella se distinguen varios periodos recién nacido (0-6 días), neonato (7-29 días), lactante (lactante menor 1-12 meses de vida, lactante mayor 1-2 años), preescolar (2-5 años), escolar (5-10 años), pre-adolescente (10-12 años) y adolescente (12-18 años).'),
(53, 0, 'PSIQUIATRÍA', ' Es la especialidad de la medicina que se ocupa del estudio, el diagnóstico, el tratamiento y la prevención de las enfermedades mentales de carácter orgánico y no orgánico.'),
(54, 0, 'PSIQUIATRÍA INFANTO JUVENIL', ' Es la especialidad de la medicina que se ocupa del estudio, el diagnóstico, el tratamiento y la prevención de las enfermedades mentales de carácter orgánico y no orgánico, de las distintas etapas del desarrollo de la población infanto-juvenil.'),
(55, 0, 'RADIOTERAPIA O TERAPIA RADIANTE', ' Es una especialidad médica , dedicada a los aspectos diagnósticos, cuidados clínicos y terapéuticos del enfermo oncológico, primordialmente orientada al empleo de los tratamientos con radiaciones. Emplea rayos X y rayos gamma de alta energía (fotones de alta energía), haces de electrones y otras radiaciones ionizantes para el tratamiento de ciertas clases de cáncer.'),
(56, 0, 'REUMATOLOGÍA', ' Es una especialidad médica, rama de la medicina interna y la pediatría, dedicada a los trastornos médicos del aparato locomotor y del tejido conectivo, que abarca un gran número de entidades clínicas conocidas en conjunto como enfermedades reumáticas, a las que se suman un gran grupo de enfermedades de afectación sistémica las enfermedades del colágeno'),
(57, 0, 'REUMATÓLOGO INFANTIL', ' Es la especialidad pediátrica en la evaluación y tratamiento de diversos trastornos de las articulaciones, los músculos y los huesos'),
(58, 0, 'TERAPIA INTENSIVA', ' Es una especialidad médica dedicada al suministro de soporte vital o de soporte a los sistemas orgánicos.'),
(59, 0, 'TERAPISTA INTENSIVO INFANTIL', ' Es una especialidad médica dedicada al suministro de soporte vital o de soporte a los sistemas orgánicos en los pacientes pediátricos que están críticamente enfermos, quienes generalmente también requieren supervisión y monitorización intensiva.'),
(60, 0, 'TOCOGINECOLOGÍA', ' Es especialidad médica y quirúrgica que trata las enfermedades del sistema reproductor femenino (útero, vagina y ovarios). Además existe, relación, la especialidad de obstetricia, a tal punto que casi todos los ginecólogos modernos son también médicos obstetras la especialidad médica que se ocupa del embarazo, el parto y el puerperio, principalmente en situaciones de riesgo que requieran de una intervención quirúrgica. Como especialidad médica la obstetricia es combinada con la ginecología bajo la disciplina conocida como obstetricia y ginecología (toco ginecólogo).'),
(61, 0, 'TOXICOLOGÍA', ' Una especialidad médica que estudia los efectos nocivos de los agentes químicos y de los agentes físicos (agentes tóxicos) en los sistemas biológicos y que establece además, la magnitud del daño en función de la exposición de los organismos vivos a dichos agentes. Se ocupa de la naturaleza y de los mecanismos de las lesiones y de la evaluación de los diversos cambios biológicos producidos por los agentes'),
(62, 0, 'UROLOGÍA', ' Es la especialidad médico-quirúrgica que se ocupa del estudio, diagnóstico y tratamiento de las patologías que afectan al aparato urinario, glándulas suprarrenales y retroperitoneo de hombres y mujeres y el aparato reproductor masculino.');
